import React, {useState} from 'react'

const Count = () => {
    const [count, setCount] = useState(0)
    
    const countHandeler = () => {
        setCount((prevCount) => {
            return prevCount + 1
        })
        setCount((prevCount) => {
            return prevCount + 1
        })
    }
  return (
    <div>
        <h1>{count}</h1>
        <button onClick={countHandeler}>Increment</button>
        <h1>{count}</h1>
    </div>
  )
}

export default Count
